window.bookSummaryJSON = "<p>It's out there, it's always been out there - just no one believed it. </p> <p>Governments, black ops, rich businessmen.... All want alien tech, and some are going to great lengths, illegal lengths, to procure it.</p> <p>Someone went so far as to endanger a young girls family. A young girl who wrote a letter to the Queen Bitch. Now, those that are searching for the technology will have to deal with TQB.</p> <p>If there is one thing that will get Bethany Anne's attention... it's mistreating the defenseless.</p> <p>Bethany Anne tries to stay out of the world's business, but they just keep doing stupid stuff....</p> <p>Sucks to be them.</p>"; 
